DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `stok` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `stok` AFTER INSERT ON `tb_permintaan` FOR EACH ROW BEGIN
update tb_pupuk set tb_pupuk.`stok` = tb_pupuk.`stok` - `tb_permintaan`.`jumlah`
