 `kd_desa` varchar(5) ,
 `nama_desa` varchar(25) ,
 `nama_kecamatan` varchar(50) ,
 `polygon` mediumtext 
)*/;

/*View structure for view tampil_desa */

/*!50001 DROP TABLE IF EXISTS `tampil_desa` */;
/*!50001 DROP VIEW IF EXISTS `tampil_desa` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `tampil_desa` AS select `tb_desa`.`kd_desa` AS `kd_desa`,`tb_desa`.`nama_desa` AS `nama_desa`,`tb_kecamatan`.`nama_kecamatan` AS `nama_kecamatan`,`tb_desa`.`polygon` AS `polygon` from (`tb_desa` join `tb_kecamatan` on((`tb_desa`.`kd_kecamatan` = `tb_kecamatan`.`kd_kecamatan`))) group by `tb_desa`.`nama_desa` */;

